snippet.textDisplay:
For anyone and everyone whosoever is going through a tough phase this song is like magic. Wear your earphones and Shreya Mam will whisper and humm so sweetly in your ears you will feel your tensions melting away. What a composition honestly, so calming. This is such an appropriate song for mental health, so calming. I love every second of this ❤
@3:22 the eyes just well up thinking about everything that's been going in life and post that you again are soothed so much. Pure magic

I can absolutely feel this like Maa Yashoda is singing this song to Lord Krishna like a lullaby after a whole day of playing and fighting demons. In a way we can listen to this after fighting our inner demons the whole day. ❤

